USE dbjbrequisition;
GO
ALTER PROC [dbo].[proc_micr_req_process] 
@slreq INT,
@tr_type CHAR(1),
@branch_code varchar(4), 
@acc_type varchar(2), 
@acc_number VARCHAR(13),
@leaf_qnty INT,
@no_books INT,
@currsoftdate DATE,
@entryuserid VARCHAR(10), 
@ipaddress VARCHAR(20)
as
BEGIN
--===========================
		DECLARE @error INT, @message varchar(4000), @xstate INT;

	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;
	SET XACT_ABORT ON 

	DECLARE @trancount INT;
	SET @trancount = @@trancount;
	BEGIN TRY
		IF @trancount = 0
			BEGIN TRANSACTION
		ELSE
			SAVE TRANSACTION proc_micr_req_process;
--===========================
IF @tr_type='I'
BEGIN
INSERT INTO tbl_Requisition (Brcode,acc_type,acnumber,LeafQty,NoBook,EntUserid,Entdate,user_ip_address)
VALUES (@branch_code,@acc_type,@acc_number,@leaf_qnty,@no_books,@entryuserid,@currsoftdate,@ipaddress)
	SET @message = 'Successfully Saved';
END
ELSE IF @tr_type='U'
BEGIN
UPDATE tbl_Requisition set brcode=@branch_code,acc_type=@acc_type,acnumber=@acc_number,LeafQty=@leaf_qnty,NoBook=@no_books,EdtUserid=@entryuserid,Edtdate=@currsoftdate,edt_ip_address=@ipaddress where Reqno=@slreq
	SET @message = 'Successfully Updated';
END
ELSE IF @tr_type='D'
BEGIN
UPDATE tbl_Requisition set process_status='D',EdtUserid=@entryuserid,Edtdate=@currsoftdate,edt_ip_address=@ipaddress where Reqno=@slreq
	SET @message = 'Deleted';
END

		--IF @systemstatus='N' --System Closed
		--BEGIN
		--SET @trancount = 1;
		--SET  @xstate = 1;
		--SET @message = '<SPAN class="error">Sorry, System Already Closed</SPAN>';
		--RAISERROR ('proc_micr_req_process: %d: %s', 2, 1, 1, @message);
		--GOTO lbexit
		--END

	


--=======================
lbexit:
		IF @trancount = 0	
			COMMIT;
	END TRY
	BEGIN CATCH
		SELECT @error = ERROR_NUMBER(), @message = ERROR_MESSAGE(), @xstate = XACT_STATE();
		IF @xstate = -1
			ROLLBACK;
		IF @xstate = 1 and @trancount = 0
			ROLLBACK
		IF @xstate = 1 and @trancount > 0
			ROLLBACK TRANSACTION proc_micr_req_process;

		RAISERROR ('proc_micr_req_process: %d: %s', 2, 1, @error, @message);
	END CATCH	

select @message;
--=======================


END
GO


